The previous models focused on fairness as a deviation from a proportional split based on token contributions.  However,  responders might not explicitly calculate a "fair" share but rather compare their offer to their own contribution and the opponent's offer.  A simple model capturing this could be based on relative gain and a sensitivity to the opponent's perceived greed.

**Key Psychological Mechanisms:**

1. **Self-interest:** Responders prefer larger monetary gains.
2. **Relative Gain:** Responders compare their proposed share to their own contribution (token_self). A larger share relative to their contribution is more appealing.
3. **Opponent's Greed:** Responders may be sensitive to how much the opponent is requesting compared to their contribution (token_opp).  A large opponent's share relative to their contribution could lead to rejection.

**How these Mechanisms Interact:**

The utility of accepting an offer should increase with the responder's share (`split_self`) relative to their contribution (`token_self`). However, this increase should be moderated by the opponent's share (`split_opp`) relative to their contribution (`token_opp`).  A high opponent gain compared to their contribution implies "greed," reducing the utility of accepting.

**Mathematical Form:**

We can capture this with a multiplicative interaction between relative gain and a penalty based on the opponent's relative gain.

**Parameters:**

1.  `relative_gain_weight`:  Determines the weight given to the relative gain of the responder.  Higher values indicate a stronger preference for higher relative gain.
2.  `opponent_greed_sensitivity`: Determines the sensitivity to the opponent's relative gain. Higher values mean a stronger negative influence from the opponent's perceived greed.

**Model Variables Mapping to Observable Behavior:**

Higher values of `relative_gain_weight` and lower values of `opponent_greed_sensitivity` will predict acceptance of a wider range of offers.

